import React from 'react';

import Query from './components/query';
import SECTIONS_QUERY from '../apollo/queries/posts/posts';

export default props => {
    return (
        <Query query={SECTIONS_QUERY}>
            {({ data: { sections } }) => {
                return <p>{JSON.stringify(sections)}</p>
            }}
        </Query>
    );
}
